      "_id" : "NdA685FwrJXs844DT", 
      "title" : "美国留学生该如何应对春季过敏", 
      "content" : "<h3>该如何应对春季过敏的问题？</h3><p><br></p><h4>重视过敏</h4><p><br></p><p>首先，要重视过敏问题。网络上不少人认为，过敏是一种 “娇气” 的病，甚至有人认为过敏是 “矫情”“做作”“不给面子”，这样的观点在微博上一抓一大把.....</p><p><img data-fr-image-pasted=\"true\" src=\"data:image/png;base64,\" class=\"fr-fic fr-dii\"></p><p>来自微博网友的分享</p><p>不少网友讲出了她们的经历，酒精过敏拒绝喝酒，被认为是 “不给面子”，海鲜过敏决绝吃虾，被指责是 “矫情”......</p><p><br></p><p>然而，过敏是一个需要受到重视的事情，严重的过敏症状甚至会危及生命，所以对待过敏问题，千万不可掉以轻心，万万不可拿生命开玩笑。在美国，人们普遍重视过敏问题，常见的食品包装上，日用品包装上，都清楚的标明了各种成分的名称和含量。</p><p><br></p><h4>寻找正确的方法对症下药</h4><p><br></p><p>应对过敏问题的关键，就是要远离过敏原。首先，要找到自己的过敏原。最常见的引起春季过敏的过敏原就是空气中的花粉了。即使是在美国长大的人，也很容易对花粉出现过敏症状。美国华人圈里还流传着如果一个人到美国时间长了（一般是 4 到 5 年），就很容易出现花粉过敏症状，如果克服了过敏的症状，那么之后都不会过敏了。</p><p><br></p><p>然而这时候问题就来了，为什么在国内不会对花粉过敏，出了国就过敏了呢？</p><p><br></p>", 
