      "_id" : "YiRCZ9MQEbegbCyd5", 
      "title" : "长尾水青蛾", 
      "content" : "<p>九月的东京，天气渐凉，白天穿短袖，晚上就得裹上一件外套了。我有许多奇怪的朋友，虽然对他们来说，我更为奇怪。</p><p>&nbsp;</p><p>“欸，我待在筑波。”台湾人小虎知道我来了日本，发来短讯说。</p><p>“筑波有什么啊？”</p><p>“植物园、筑波山和我。”</p><p>隔了几日，我才问：“你住的附近呢？”</p><p>“旁边是小森林和稻田。”</p><p><br></p><p>她受台北中央研究院的教授之邀，来筑波做一个月的助理，采集日本阿尔卑斯山区的蛾类标本。她住在植物园旁边，是筑波科学博物馆的宿舍，到东京得一个半小时。在探讨了无聊的筑波后，我纵容了我的拖延症。于是计划变成她来东京看我。</p><p>&nbsp;</p><p>我们约好10点钟在秋叶原站的无印良品结账柜台见，后来发现无印良品11点才开门，便将地点改在对面的全家便利店，仿佛《1984》中要不断更换的接头地点。</p><p>&nbsp;</p><p>“不好意思我迟到了。”她抱歉地说。她留着短发，脸依然清秀，只是多了一些岁月的痕迹；穿着白色短袖T恤、白裙子，在米色帆布包的提带上打结——最近的日本很时兴这样；手腕上纹着两只猫，手中握着五六年前的苹果手机。大家叫她小虎，也许是因为她长着一对虎牙。但在日本人的审美中，美女一般是牙齿既不好又不整齐，因为日本人认为整整齐齐长着一口白生生牙齿的人，给人一种刻薄、奸黠、残忍的印象。[1]</p><p>&nbsp;</p><p>“好久不见。”</p><p><br></p><p><img data-fr-image-pasted=\"true\" src=\"blob:http://localhost:5000/97d994e7-25d5-4c3c-8039-f2b84999b674\" alt=\"\" class=\"fr-fic fr-dii\"></p><p>（浅草）</p><p><img data-fr-image-pasted=\"true\" src=\"https://b3-q.mafengwo.net/s11/M00/C9/28/wKgBEFrVnfWAUIcEAAUFZSHJRjw73.jpeg?imageView2%2F2%2Fw%2F600%2Fh%2F600%2Fq%2F90\" alt=\"\" class=\"fr-fic fr-dii\"></p><p>（浅草寺）</p><p><br></p><p>见面后她打算去浅草寺旁的织布博物馆看看，于是坐车到浅草寺。过雷门时她并没有表示出兴趣，我们挑僻静的街巷走，游客还是迅速溢满了每一条道。织布博物馆令她有些失望，这不过是一个纪念品商店的附属。</p><p>&nbsp;</p><p>我们之间的对话也有异于一般旅人，我说了很多对日本的印象、发现和有意思的文化差异，她只是应声，也不反对。</p><p>&nbsp;</p><p>坐电铁到神保町旧书街，这里堆满了形形色色的新旧书刊。我们随意走进一家旧书店，书架上的书大部分与蝴蝶有关。</p><p>&nbsp;</p><p>“你的老板研究蝴蝶？”</p><p>“不，是蛾。他平常不准我们说蝴蝶，蝴蝶与蛾不一样，种类不到蛾的十分之一，你可以轻易地找到一本日本的蝴蝶大全，但蛾却很少有完整的图集出版，全世界蛾的种类太多了。”</p><p>我从书架中抽出一本亚洲蛾类大全，问道：“蝴蝶和蛾有什么区别？”</p><p>“一般人分不清，很多蛾都被当做蝴蝶，蛾一般在夜晚活动，而且大多数比蝴蝶更漂亮。”</p><p>“比蝴蝶更漂亮？”这样的说法我倒是第一次听说，对蛾的印象大概还停留在令人毛骨悚然的飞蛾上面。</p><p>“嗯。我们在富士山捕过一种长尾水青蛾，见到时被她惊艳到了，像穿着青衣长衫的小倩。”她这么一说我更觉得蛾诡异了。</p><p>“你们把它做成标本了？”</p><p>“没有，放生了，因为已经采集过，目睹就很荣幸了。”</p><p>“日本允许你们采蛾？”</p><p>“不怎么管，或许也采不完，或许大家都有一种潜在的默契，不要触碰那些底线就行了。”</p><p>&nbsp;</p><p>至于底线是什么，我没有问，我对日本法律了解得不多，而且中国的土地国有，土地上的附着物很多也国有，所以我很难想象一种资源作为全人类、跨国界共有的状态。</p><p>&nbsp;</p><p>我们又去了一家建筑古籍书店，在阁楼间翻阅那些已经过时的建筑论著，仿佛置身一家二手唱片行。台湾艺术大学毕业的小虎以前是美术生，她对文具店的画笔更感兴趣，原来不同的兴趣是因为我们熟悉的领域不一样。</p><p><br></p><p><img data-fr-image-pasted=\"true\" src=\"data:image/png;base64,\" alt=\"\" class=\"fr-fic fr-dii\"></p><p>（小虎的环岛旅行 &nbsp;Photo by 叮咚）</p><p>&nbsp;</p><p>我们聊到各自的近况。小虎在旅行完欧洲、南亚后，开着一辆家里拉货的三菱面包车，开始为期半年的环台湾岛旅行，要说原因呐，大概和我还有些关系。我们认识于她去西藏之前，那时候我热衷于藏区的湖山、宗教、歌谣、服饰、语言、部落，准备投身于藏学的志业之中，她大概是受到感染，觉得自己对身边的土地一无所知，于是将旧面包车改装成流动小贩摊，带着她的猫环岛，贩卖手工制作的羊毛毡、吃路边小店、帮沿途的农场种地和打扫、在天台或路边搭帐篷睡觉，过着一种波西米亚式的生活。</p><p>&nbsp;</p><p>“生意怎么样？”我问得很直接。</p><p>“在台北还可以，出了台北基本上无人问津。”</p><p>&nbsp;</p><p>有人说渴望田园牧歌的生活是一种城市病，真正到了田园，就只剩下牧歌了。但小虎似乎要笃定得多，最近她搬回了距离台北半小时的老家的房子，要坐火车才能到台北，她就在那里生活、做手工，还打算开一间周末咖啡馆。</p><p>&nbsp;</p><p>干燥的秋天，风和日丽，让我怀念大学时光。所以多走了一段，走到了皇居外苑。日本天皇已成为名义元首了，但皇宫仍在使用。城外一道护城河，巨大的石头垒成石墙，城内是葱绿的草坪，却连皇宫的大门也没见到。</p><p><br></p>", 
