      "_id" : "3fRJNBhDr7hFtWpq8", 
      "type" : 9, 
      "title" : "What’s so great about teaching kindergarten?", 
      "content" : "<p><img class=\"\" src=\"https://mmbiz.qpic.cn/mmbiz_jpg/icN3icoOj0e0yibfuxjicO4x42hRW0RxK0ZRTN0iaZHIIubLa2pOAQaKzjpu3icVWufLvFopCibcdjjK2vYaOSJUkFyiaA/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\"></p>\n<section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<h2></h2>\n</section>\n</section>\n</section>\n</section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<h2 style=\"text-align:center;\"><strong>Kindergarteners are eager to please and easy to make happy</strong></h2>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<p>It has been my experience that students between the ages of three and six are really eager to please their teachers.</p>\n<p>This is especially true if they feel like their teacher knows how to motivate their students and engage with them in the lesson. Young kids are very impressionable, if you feel a certain way, they will too. If you are excited about something, they are excited too!</p>\n<p>Make sure to give high fives, stars, and stickers! They will be overcome with happiness and enjoy learning in your class. Students at this age are easy to motivate.</p>\n<section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<h2 style=\"text-align:center;\"><strong>Everything is new and exciting</strong></h2>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<p>Most of what you teach them are new to them. It’s enjoyable to teach children about things they’ve never been shown before. It’s also entertaining to come up with fun and interactive lessons.</p>\n<p>Since kindergarteners need to learn so much, you can come up with activities that will engage them and make learning really fun.</p>\n<section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<h2 style=\"text-align:center;\"></h2>\n</section>\n</section>\n</section>\n</section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<h2 style=\"text-align:center;\"><strong>You are making a difference</strong></h2>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<p>Know that you will make a huge difference in the lives of young learners. You will give them experiences that will have a lasting impact on their lives.</p>\n<p>When they are grown, they won’t remember you, but they may remember the activities or how they felt at the time. It is truly amazing to know that how much of an impact a kindergarten teacher can make on a child’s development.</p>\n<section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section>\n<section></section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<h2 style=\"text-align:center;\"><strong>Kindergarteners are funny, and they think you’re funny</strong></h2>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<p>Kindergarteners say funny things. Sometimes they do it on purpose, but most of the time they don’t. Since they speak very, very limited English, it will mostly be what they do that is really funny</p>\n<p>These kinds of moments make the job worthwhile. You just never know what these kids will do or say.</p>\n<p>Kindergarteners also don’t judge when you make a fool of yourself. You can get up and dance, sing, make faces and all sorts of crazy things and they love it. Middle schoolers and above will think it’s crazy and stupid, but kindergarten students will enjoy every moment of it.</p>\n<p>It can be enjoyable to act like a five-year-old sometimes! Don’t feel embarrassed, own it! Your students will learn thanks to the energy you put into the lesson.</p>\n<section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section>\n<section></section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<section class=\"\">\n<h2 style=\"text-align:center;\"><strong>You get to see them progress through the year</strong></h2>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n</section>\n<p>You will do a lot of repeating and practice with your students, but your students will learn very quickly!</p>\n<p>You will see enormous progress in your students over the course of a year and be able to say confidently, you helped them get there.</p>", 
